// src/components/TutoringHistory.js
import React, { useState } from 'react';
import { Box, Grid, Typography, Paper, List, ListItem, ListItemText, Divider } from '@mui/material';
import { styled } from '@mui/material/styles';

const TutoringHistory = () => {
  // Dummy data for session feedback
  const [sessions, setSessions] = useState([
    {
      id: 1,
      date: '2024-09-01',
      subject: 'Mathematics',
      topic: 'Algebra',
      feedback: 'Good',
      comments: 'Solid understanding of algebraic equations, but needs more practice on solving word problems.',
      improvements: 'Focus on word problem strategies.',
      moreTimeNeeded: false,
    },
    {
      id: 2,
      date: '2024-09-03',
      subject: 'Biology',
      topic: 'Cell Structure',
      feedback: 'Average',
      comments: 'Understands basic cell structures but struggles with functions of organelles.',
      improvements: 'Review organelle functions and complete related exercises.',
      moreTimeNeeded: true,
    },
    // Add more sessions as needed
  ]);

  return (
    <Box component="main" sx={{ flexGrow: 1, p: 3, backgroundColor: '#2c2c2c', color: '#fff', minHeight: '100vh' }}>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <Box display="flex" justifyContent="space-between" alignItems="center">
            <Typography variant="h4">Tutoring History</Typography>
          </Box>
        </Grid>

        <Grid item xs={12}>
          <StyledPaper>
            <Typography variant="body1">
              Here you can see the history of your tutoring sessions.
            </Typography>
            <List>
              {sessions.map((session) => (
                <React.Fragment key={session.id}>
                  <ListItem>
                    <ListItemText
                      primary={`${session.subject} - ${session.topic}`}
                      secondary={`Date: ${session.date}`}
                    />
                  </ListItem>
                  <ListItem>
                    <ListItemText
                      primary={`Feedback: ${session.feedback}`}
                      secondary={
                        <>
                          <Typography variant="body2">
                            Comments: {session.comments}
                          </Typography>
                          <Typography variant="body2">
                            Improvements: {session.improvements}
                          </Typography>
                          {session.moreTimeNeeded && (
                            <Typography variant="body2" color="error">
                              More time needed on this topic.
                            </Typography>
                          )}
                        </>
                      }
                    />
                  </ListItem>
                  <Divider />
                </React.Fragment>
              ))}
            </List>
          </StyledPaper>
        </Grid>
      </Grid>
    </Box>
  );
};

const StyledPaper = styled(Paper)({
  padding: '20px',
  marginBottom: '20px',
  backgroundColor: '#333',
  color: '#fff',
  borderRadius: '8px',
  boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
});

export default TutoringHistory;
